	  if (available_part) {
	      CompWeight4 = PartWeight * Inputs.var_tapeendqty.Value;
	  }

	 /* Inputs.var_topcappartnum.Value : CompWeight5 */
	  if (Inputs.var_topcappartnum.Value != "")
	  {
	      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_topcappartnum.Value, out PartWeight);

	  }
	  if (available_part) {
	      CompWeight5 = PartWeight * Inputs.var_topcapqty.Value;
	  }

	 /* Inputs.var_topperpart.Value : CompWeight6 */
	  if (Inputs.var_topperpart.Value != "")
	  {
	      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_topperpart.Value, out PartWeight);

	  }
	  if (available_part) {
	      CompWeight6 = PartWeight * Inputs.var_topperqty.Value;
	  }

	 /* Inputs.var_rivetpart.Value : CompWeight7 */
	  if (Inputs.var_rivetpart.Value != "")
	  {
	      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_rivetpart.Value, out PartWeight);

	  }
	  if (available_part) {
	      CompWeight7 = PartWeight * Inputs.var_rivetqty.Value;
	  }

	 /* Inputs.var_topperscrewpart : CompWeigh8 */
	  if (Inputs.var_topperscrewpart.Value != "")
	  {
	      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_topperscrewpart.Value, out PartWeight);

	  }
	  if (available_part) {
	      CompWeight8 = PartWeight * Inputs.var_topperscrewqty.Value;
	  }

	 /* Inputs.var_addpackpart : CompWeigh9 */
	  if (Inputs.var_addpackpart.Value != "")
	  {
	      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_addpackpart.Value, out PartWeight);

	  }
	  if (available_part) {
	      CompWeight9 = PartWeight * Inputs.var_addpackqty.Value;
	  }


	  /* Totals the individual component weights */
	  Inputs.var_netweight.Value = CompWeight1 + CompWeight2 + CompWeight3 + CompWeight4 + CompWeight5 + CompWeight6 + CompWeight7 + CompWeight8 + CompWeight9;

	  /* Used to display Netweight list incase verification is required */
	  Inputs.var_weightlookup.Value = "1(" + CompWeight1.ToString() + ")" + " - 2(" + CompWeight2.ToString() + ")" + " - 3(" + CompWeight3.ToString() + ")" + " - 4(" + CompWeight4.ToString() + ")" + " - 5(" + CompWeight5.ToString() + ")" + " - 6(" + CompWeight6.ToString() + ")" + " - 7(" + CompWeight7.ToString() + ")" + " - 8(" + CompWeight8.ToString() + ")" + " - 9(" + CompWeight9.ToString() + ")";

	  /* Returns Commodity Code from CSV */
	  Inputs.var_commodity.Value = PCLookUp.DataLookup("TENUK_FG_MasterTable", "commodity_code", Inputs.var_fgnum.Value);

	  /* If no commodity code is returned from the CSV file it checks the parts master table */
	  string partclass = "";
	  partclass = "";
	  if (Inputs.var_commodity.Value == "")
	  {
	      available_part = UDMethods.GetPartClass(Context.CompanyID, Inputs.var_fgnum.Value, out partclass);
	  }

	  /* As Part Class is used to assign Commodity Code */
	  string PartClassCommodityCode = "";
	  if ((Inputs.var_commodity.Value == "") && (partclass != ""))
	  {
	      bool available_partclass = UDMethods.GetPartClassCommodity(Context.CompanyID, partclass, out PartClassCommodityCode);
	      if (available_part) {
	          Inputs.var_commodity.Value = PartClassCommodityCode;
	      }
	  }

	  /* Verifies Commodity code exists in IComCode Table within Epicor */
	  string commoditycheck = "";
	  commoditycheck = "";
	  if (Inputs.var_commodity.Value != "")
	  {
	      bool available_ICommCode = UDMethods.GetICommImportCode(Context.CompanyID, Inputs.var_commodity.Value, out commoditycheck);
	  }

	  if (Inputs.var_commodity.Value != commoditycheck)
	  {
				MessageBox.Show("The Configurator has assigned a Commodity code that does not have a corresponding Epicor record, please contact the Operations department to correct this error.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
				PageLeaveFunctions.SetNextInputPage(1);
				Args.Cancel = true;
	  }

	  if (Inputs.var_commodity.Value == "")
	  {
				MessageBox.Show("The Configurator has been unable to determine the Commodity Code for the chosen configuration. Please contact the Operations department.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
				PageLeaveFunctions.SetNextInputPage(1);
				Args.Cancel = true;
	  }
	  else if ((Inputs.var_commodity.Value != "") || (Inputs.var_commodity.Value == commoditycheck))
	  {
	      PageLeaveFunctions.SetNextInputPage(4);
	  }

	  /* ********************************************************************************************************************************************************************************** */

		/* Pack Comment */
		string Mode = "";
		int CustID = 0;
		int OrderNum = 0;
		int QuoteNum = 0;
		string CustCountry = "";
		string CustName = "";
		string OTSID = "";
		bool OTS = false;
		int OTSCountry = 0;

		/* Determines Current Configuration Mode and order/quote specifics */
		Mode = Context.Entity;
		CustID = 0; /* Set to Zero when not used for testing*/
		CustCountry = "";
		OrderNum = Context.OrderNumber;
		QuoteNum = Context.QuoteNumber;


	  /* ********************************************************************************************************************************************************************************** */
    if (Mode == "Quote")
    {
					/* Retrieve details from Quote Header */
					bool available_QuoteHed = UDMethods.GetQuoteHed(Context.CompanyID, QuoteNum, out CustID, out OTSID, out OTS);

					if (available_QuoteHed)
					{
						Inputs.var_custid.Value = CustID;
					}

			    /* Retrieves customer name using customer ID */
			     bool available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry);

			    /* ************************************************************** */

			    /* If a saved shipto address is specified gets country info */
			    if (OTSID != "")
			    {
			        bool available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
			        bool available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);
			    }

          Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + QuoteNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
          Inputs.var_shipcountry.Value = CustCountry;

		}

    /* ********************************************************************************************************************************************************************************** */
    if (Mode == "Order")
    {
					/* Retrieve details from Order Header */
					bool available_QrderHed = UDMethods.GetOrderHed(Context.CompanyID, OrderNum, out CustID, out OTSID, out OTS);

					if (available_QrderHed)
					{
						Inputs.var_custid.Value = CustID;
					}

			    /* Retrieves customer name using customer ID */
			    bool available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry);

					/* ************************************************************** */

					/* If a saved shipto address is specified gets country info */
					if (OTSID != "")
					{
						bool available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
						bool available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);
					}

					Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + OrderNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
					Inputs.var_shipcountry.Value = CustCountry;

			}

    /* ********************************************************************************************************************************************************************************** */
    if (Mode == "PcStatus")
    {

        Inputs.var_orderdtl.Value = "Mode: " + Mode;
        /* Inputs.var_shipcountry.Value = "Albania". */

        Inputs.var_custid.Value = 11131;

    }

		/* ********************************************************************************************************************************************************************************** */
    string palletlookup = "";

    palletlookup = "";

    /* Finds Pallet lookup from csv based on Shipping country*/
    palletlookup = PCLookUp.DataLookup("CountryPalletList", "pallet_type", Inputs.var_shipcountry.Value);

    if (palletlookup != "")
    {
        Inputs.var_palletlookup.Value = palletlookup + "_Lookup";
        Inputs.var_packcomment.Value = PCLookUp.DataLookup("CountryPalletList", "default_message", Inputs.var_shipcountry.Value);
    }

    if (palletlookup == "") { Inputs.var_palletlookup.Value = "All_Lookup"; }

}

/* ********************************************************************************************************************************************************************************** */

/* Determine the Wallm operation cycle time based on FG Number */


/* Find Wallm cycle_time_selector */
string wallmcycletimelookup = "";
wallmcycletimelookup = "std";


/* Returns cycletime from Master FG List CSV */

string wallmcycletimeselector = "";

wallmcycletimeselector = wallmcycletimelookup + "_op_time_min";
Inputs.var_op20time.Value = UDMethods.ConvertToDecimal(PCLookUp.DataLookup("TENUK_FG_MasterTable", wallmcycletimeselector, Inputs.var_fgnum.Value));


/* ********************************************************************************************************************************************************************************** */

/* Sets conditions if the Order/Quote being keyed is for RS Components which requires selection of an RS Label in the BOM */

if (Inputs.var_custid.Value == 1113) {
  Inputs.var_rslabelpart.Invisible = false;
  Inputs.var_rslabelqty.Invisible = false;
  Inputs.chk_rslabelnone.Invisible = false;
  Inputs.TEXT15.Invisible = false;
  PageLeaveFunctions.SetNextInputPage(3);
}

if (Inputs.var_custid.Value != 1113) {
  Inputs.var_rslabelpart.Invisible = true;
  Inputs.var_rslabelqty.Invisible = true;
  Inputs.chk_rslabelnone.Invisible = true;
  Inputs.TEXT15.Invisible = true;
  PageLeaveFunctions.SetNextInputPage(4);
}

/* ********************************************************************************************************************************************************************************** */

/* Ensures a webbing has been selected if using the web search feature */

if ((Inputs.chk_websearchon.Value == true) && (Inputs.cmb_webbingfinish.Value == "")) {

		MessageBox.Show("You are using the Web. Search feature and have tried to leave the page without selecting an actual webbing finish. Please correct this before proceeding. ", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
		PageLeaveFunctions.SetNextInputPage(1);
		Args.Cancel = true;

}

/* ********************************************************************************************************************************************************************************** */

/* Amazon Requirement */

if (Inputs.var_custid.Value == 3814) {

	string flagident3814 = "";
	string custpartnum3814 = "";
	string custintpart3814 = "";
	string custdesc3814 = "";
	custpartnum3814="";
	custintpart3814="";
	custdesc3814="";

  flagident3814 = Inputs.var_smart2.Value;

  custpartnum3814 = PCLookUp.DataLookup("Amazon_CustomerPartRefs", "cust_part", flagident3814);
  custintpart3814 = PCLookUp.DataLookup("Amazon_CustomerPartRefs", "cust_int_part", flagident3814);
  custdesc3814 = PCLookUp.DataLookup("Amazon_CustomerPartRefs", "cust_desc", flagident3814);

  if (custpartnum3814 != "") {
    Inputs.var_qmaticfgnum.Value = custpartnum3814;
    Inputs.var_fgdesc.Value = custdesc3814;
    Inputs.var_fgnum.Value = custintpart3814;
  }

  if ((Inputs.var_qmaticfgnum.Value =="") && (Inputs.chk_erroron.Value == true )) {
		MessageBox.Show("The configurator has been unable to determine the customer part cross reference for this specific configuration, which has been defined as a mandatory requirement for this account. Please discuss this issue with your Epicor system administrator;", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
		PageLeaveFunctions.SetNextInputPage(1);
		Args.Cancel = true;
  }

}

/* ********************************************************************************************************************************************************************************** */
/* Set FG Num to output to Sales Line */
Inputs.var_fgsaleslinepart.Value = Inputs.var_smart2.Value;
if ((Inputs.var_custid.Value == 3814) && (Inputs.var_qmaticfgnum.Value !="")) {Inputs.var_fgsaleslinepart.Value = Inputs.var_fgnum.Value;}

/* ****************************************************************************************************************** */ 

if ((Inputs.var_fgdesc.Value =="") && (Inputs.chk_erroron.Value == true )) {
		MessageBox.Show("No Description has been returned for the Finished Goods Number.........", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
		PageLeaveFunctions.SetNextInputPage(1);
		Args.Cancel = true;
}

if ((Inputs.var_custid.Value == 1113) && ( Inputs.var_rslabelpart.Value=="") && ( Inputs.chk_rslabelnone.Value == false)) {

	MessageBox.Show("You are keying a Quote/Order for RS Components, please enter an RS Label part number and/or quantity to proceed. If an RS label is not required please check the No RS Label Rqd check box.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
	PageLeaveFunctions.SetNextInputPage(3);
	Args.Cancel = true;

}

