	MessageBox.Show("You are keying a Quote/Order for RS Components, please enter an RS Label part number and/or quantity to proceed. If an RS label is not required please check the No RS Label Rqd check box.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
	PageLeaveFunctions.SetNextInputPage(3);
	Args.Cancel = true;
}








